import "./Navbar.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav class="nav-bar">
	<a href="" class="brand-tag">BrandName</a>
	<div class="nav-input input input-basic">
		<input type="text" placeholder="Search" />
	</div>
	<div class="nav-links">
		<a href="" class="button ">Login</a>
		<a class="icon-container">
			<img class="icon" src="./assets/heart-solid.svg" alt="home icon"/>
			<span class="icon-badge">0</span>
		</a>        
		<a class="icon-container">
			<img class="icon" src="assets/cart-shopping-solid.svg" alt="home icon"/>
			<span class="icon-badge">0</span>
		</a>
	</div>
</nav>
  );
};

export { Navbar };
